<template>
  <div class="page-wrap">
    <mt-header title="京东乐购"></mt-header>
    <div class="mint-searchbar1">
      <form class="search-block" action="javascript:return true">
        <el-input type="search" placeholder="请输入内容" v-model="searchValue" class="input-with-select" @keyup.13="searchFn" @keypress="searchFn(e)">
          <el-select v-model="select" slot="prepend" placeholder="请选择" style="width:96px;" >
            <el-option v-for="itme in category" :label="itme.product_category" :value="itme.product_category" :key="itme.product_category"></el-option>
          </el-select>
          <el-button slot="append" icon="el-icon-search" @click="searchFn"></el-button>
        </el-input>
      </form>
    </div>
    <div class="page-swipe">
      <mt-swipe :auto="0">
        <mt-swipe-item class="slide1"><img style="width: 100%;" src="data:image/jpeg;base64," alt=""></mt-swipe-item>
      </mt-swipe>
    </div>


    <div>
      <ul class="category-ul">
        <li v-for="itme in category" class="category-item" @click="getProducts(itme.product_category)">
          <mt-button style="width:90%;  font-size: 13px;" >{{itme.product_category}}</mt-button>
        </li>
      </ul>
    </div>

    <div class="pro-wrap">
      <ul
        class="pro-ul"
        v-infinite-scroll="loadMore"
        infinite-scroll-disabled="loading"
        infinite-scroll-distance="10">
        <li class="pro-item" v-for="item in products"  @click="goDetailPage(item.product_rebate_url)">
          <div class="pro-msg">
            <h2 class="pro-name">{{item.product_name}}</h2>
            <dl>
              <dd>京东价：￥<span style="text-decoration:line-through;color:#666;">{{item.product_jd_price}}</span></dd>
              <dd>内购价：￥<span style="color:red;">{{item.product_token_price}}</span></dd>
            </dl>
          </div>
          <img class="lazy-img" :onerror="defaultImg" :src="item.product_img_url">
        </li>
      </ul>
    </div>


<!--    <div class="footer">-->
<!--      注意事项：-->
<!--    </div>-->
    <contact></contact>
  </div>
</template>
<script>
  import contact from './contact'
  import {MessageBox} from 'mint-ui';
  export default {
    name: 'home',
    components: {
      contact,
    },
    computed: {
      defaultImg() {
        return 'this.src="data:image/jpeg;base64,"';
      }
    },
    data() {
      return {
        select: '所有',
        count: 0,
        nowPage: 0,
        loading: false,
        category: [],
        selectCategory: "",
        products: [],
        searchValue: ''
      }
    },
    created: function () {
      this.getCategorys();
    },
    mounted: function () {
    },
    methods: {
      searchFn(e) {
        alert(e.keyCode)
        this.$router.push({
          name: 'search', params:
            {
              name: this.searchValue,
              select: this.select
            }
        })
      },
      getCategorys() {
        const _this = this;
        this.axios.get(`${this.baseUrl}/api/category`)
          .then(function (response) {
            _this.category = response.data.data
            _this.selectCategory = response.data.data[2].product_category
            _this.getProducts(response.data.data[2].product_category, _this.nowPage);
          })
          .catch(function (error) {
            console.log(error);
          })
          .then(function () {
            // always executed
          });
      },
      getProducts(category, page = 1, type = 1) {
        const _this = this;
        this.selectCategory = category
        this.axios.get(`${this.baseUrl}/api/getCategoryPro/${category}/${page}`)
          .then(function (response) {
            if (type === 1) {
              _this.products = response.data.data
              _this.count = response.data.count
            }
            if (type === 2) {
              _this.products = _this.products.concat(response.data.data)
            }
            _this.loading = false;
          })
          .catch(function (error) {
            console.log(error);
          })
          .then(function () {
            // always executed
          });
      },
      goDetailPage(href) {
        location.href = href;
      },
      loadMore() {
        this.loading = true;
        this.nowPage++;
        if ((this.nowPage - 1) * 10 < this.count && this.count > 0) {
          this.getProducts(this.selectCategory, this.nowPage, 2)
        } else {
          if (this.count > 0 && (this.nowPage - 1) * 10 > this.count) {
            MessageBox({
              title: '提示',
              message: '已经到底，没有更多了',
              showCancelButton: true
            });
          }
        }

      }
    }


  }
</script>

